export const ConsignInDemandNow = () => {
  return (
    <SectionContainer background="black100">
      <Box textAlign="left" width="100%">
        <Text textAlign={"left"} mb={2} variant="largeTitle">
          In Demand Now
        </Text>
        <Separator />
      </Box>

      <Spacer my={3} />
      <ConsignInDemandNowQueryRenderer />
      <Spacer my={4} />
      <ConsignTopArtists />
    </SectionContainer>
  )
}

const ConsignInDemandNowQueryRenderer: React.FC = () => {
  const { relayEnvironment } = useSystemContext()

  return (
    <QueryRenderer<ConsignInDemandNowQuery>
      environment={relayEnvironment}
      variables={{
        artistInternalId: "4ed901b755a41e0001000a9f", // Kehinde Wiley
        artistSlug: "kehinde-wiley",
        medium: "PAINTING",
      }}
      // FIXME: Must be logged in for diffusion data to work
      query={graphql`
        query ConsignInDemandNowQuery(
          $artistInternalId: ID!
          $artistSlug: String!
          $medium: String!
        ) {
          artist(id: $artistSlug) {
            birthday
            nationality
            auctionResultsConnection(first: 1, sort: DATE_DESC) {
              edges {
                node {
                  internalID
                  title
                  dimensionText
                  images {
                    larger {
                      url
                      resized {
                        srcSet
                      }
                    }
                  }
                  description
                  dateText
                  organization
                  saleDate
                  priceRealized {
                    display
                    centsUSD
                  }
                }
              }
            }
          }

          marketPriceInsights(artistId: $artistInternalId, medium: $medium) {
            annualLotsSold
            annualValueSoldCents
            artistId
            artistName
            artsyQInventory
            createdAt
            demandRank
            demandTrend
            highRangeCents
            largeHighRangeCents
            largeLowRangeCents
            largeMidRangeCents
            liquidityRank
            lowRangeCents
            medianSaleToEstimateRatio
            medium
            mediumHighRangeCents
            mediumLowRangeCents
            mediumMidRangeCents
            midRangeCents
            sellThroughRate
            smallHighRangeCents
            smallLowRangeCents
            smallMidRangeCents
            updatedAt
          }
        }
      `}
      render={({ props, error }) => {
        // FIXME: Error handling
        if (error) {
          return null
        }

        return (
          <>
            <Media greaterThanOrEqual="md">
              <InDemandNowLarge {...props} />
            </Media>
            <Media lessThan="md">
              <InDemandNowSmall {...props} />
            </Media>
          </>
        )
      }}
    />
  )
}

